import React, {useState} from 'react';
import styled from 'styled-components';

const Div=styled.div`
  border:solid 1px #dbdbdb;
  width:50%;
  min-width:50px;
  display:flex;
`
const MarginDiv=styled.div`
  margin:32px 0;
`
const ProfileDiv=styled.div`
  font-size:24px;
  font-weight:400;
  line-height:38px;
  display:flex;
  align-items:center;
  margin-left:60px;
`
const ProfileImg=styled.img`
  border-radius:50%;
  width:38px;
  height:38px;
  object-fit:cover;
  margin-right:25px;
`
const Prev=styled.div`
  margin-bottom:32px;
`
const New=styled.div`
  margin-bottom:32px;
`
const NewCheck=styled.div`
  margin-bottom:32px;
`
const Label=styled.div`
  font-size:16px;
  font-weight:600;
  padding:0 32px;
  flex:0 0 194px;
`
function Password() {
  return (
    <Div>
      <MarginDiv>
        <ProfileDiv><ProfileImg src='../images/activeStatus/photo.png'></ProfileImg><span>username</span></ProfileDiv>
        <Prev><Label>이전 비밀번호</Label></Prev>
        <New><Label>새 비밀번호</Label></New>
        <NewCheck><Label>새 비밀번호 확인</Label></NewCheck>
      </MarginDiv>
    </Div>
  );
}

export default Password;
